/**
 * Definition for singly-linked list.
 */
#include <algorithm>
#include <iostream>
using namespace std;

struct ListNode {
	int val;
	ListNode *next;
	ListNode() : val(0), next(0) {}
	ListNode(int x, ListNode *n) : val(x), next(n) {}
	// ListNode(int x) : val(x), next(0) {}
};
inline int listLength(ListNode *head){
	int len = 0;
	while(head){
		++len;
		head = head->next;
	}
	return len;
}
class Solution {
public:
    ListNode *sortList(ListNode *head) {
		if(head == 0 || head->next == 0) return head;
		int pivot_idx = rand()%listLength(head);
		int pitmp = pivot_idx;
		ListNode * pivot = head;

		while(pivot_idx--) pivot = pivot->next;

		int midItem = pivot->val;
		// show_num(head);
		ListNode * _head = head;
		ListNode * last = head;
		ListNode * bf_last=last;
		bool necessary = false;

		int last_pos = 0;
		while(_head != 0){

			if(_head->val != midItem) necessary = true;
			if(_head->val < midItem){

				bf_last = last;

				if(_head != last)
				swap(_head->val, last->val);
				last = last->next;
				++last_pos;
			}
			_head = _head->next;
		}
		if(last_pos < pitmp)
		swap(pivot->val, last->val);
		if(last_pos == pitmp && pivot != last)
			cout<<"DDD"<<endl;
		if(!necessary) return head;
		if(bf_last == last){
			head->next = sortList(head->next);
			return head;
		}else{
			bf_last->next = 0;
			sortList(head);
			bf_last->next = last;
			sortList(last->next);


			return head;
		}
		
    }
};
void qsort2(int src[], int len)
{
	if(len < 2) return;
	int midItem = src[0];
	int last = 0;
	for(int i=0; i<len; ++i){
		if(src[i] < midItem){
			++last;
			swap(src[last], src[i]);
		}
	}
	swap(src[last], src[0]);
	qsort2(src, last);
	qsort2(src+last+1, len-last-1);
}
void showInt(int a){ cout<<a<<" "; }
